import React from "react";

const Header = ({ onToggleMenu }) => {
  return (
    <header>
      <div className="ui top inverted attached menu">
        <span
          className="item right floated link red"
          onClick={() => {
            onToggleMenu();
          }}
        >
          Menu
        </span>
      </div>
    </header>
  );
};

export default Header;
